import React, {Component} from 'react';
import {Grid, Cell} from 'react-mdl';
import Education from './education';
import Experience from './experience';

class Resume extends Component {
	render(){
		return (
			<div>
			  <Grid>
				  <Cell col={4}>
						<div style={{textAlign:'center'}}>
						  <img
								src='https://cdn1.iconfinder.com/data/icons/user-pictures/101/malecostume-512.png'
								alt='avatar'
								style={{height: '200px'}}
							/>
						</div>
						<h2 style={{paddingTop: '2em'}}>William Sun</h2>
						<h4 style={{color:'grey'}}>Programmer</h4>
						<hr style={{borderTop:'3px solid #833FB2', width:'50%'}}/>
						<p>about text for me</p>
						<hr style={{borderTop:'3px solid #833FB2', width:'50%'}}/>
						<h5>address</h5>
						<p>heres my address maybe</p>
						<h5>Phone</h5>
						<p>(123)-456-7890</p>
						<h5>email</h5>
						<p>email here</p>
						<h5>Web</h5>
						<p>my website</p>
						<hr style={{borderTop:'3px solid #833FB2', width:'50%'}}/>
					</Cell>
				  <Cell className='resume-right-col' col={8}>
					  <h2>Education</h2>
						<Education
							startYear={2014}
							endYear={2018}
							schoolName='UIUC'
							schoolDescription='major/minor'
						/>
						<hr style={{borderTop:'3px solid #e22947'}}/>
						<h2>Experience</h2>
						<Experience
							startYear={2009}
							endYear={2012}
							jobName='first job'
							jobDescription='description for job'
						/>
						<Experience
							startYear={2009}
							endYear={2012}
							jobName='first job'
							jobDescription='description for job'
						/>
					</Cell>
				</Grid>
			</div>
		);
	}
}

export default Resume;
